import React from 'react'
import { WorkCardContainer, WorkTitle, WorkDesc, WorkLinks, WorkLink } from './MyWork.elements';

function WorkCard({image, logo, title, description, links}) {

  

  return (
      <WorkCardContainer style={{backgroundImage: `url(${image})`}}>
        <img src={logo} style={{scale: '.7'}}/>
        <WorkDesc>
          {description}
        </WorkDesc>
        <WorkLinks>
          <WorkLink></WorkLink>
        </WorkLinks>
      </WorkCardContainer>
    )
  
}

export default WorkCard
